import React, { useContext } from "react";
import AppContext from "../AppContext";
import data from "../data";

function Hot() {
  // const hots = data.filter((mem) => mem.upvotes - mem.downvotes > 5);
  const { memes } = useContext(AppContext);
  const hotMemes = memes.map((mem) => {
    return <mem key={mem.id} mem={mem} />;
  });
  return (
    <div>
      <p>Hot!</p>
      {hotMemes}
    </div>
  );
}

export default Hot;
